import './Botao.css'

const Botao = ({ nome, imagem }) => {
    return (
        <section >
            <button className='botoes' key={nome}>
                <h2> {nome} </h2> 
                <img src={imagem} alt={nome}/>
            </button>
        </section>

    )
}

export default Botao
